import React, { Component, useEffect} from 'react';
import { Route, Switch } from 'react-router-dom';
import Profile from './hoc/Menu/Profile';
import Profile_PJ from './hoc/Menu/Profile_PJ';
import styled, { ThemeProvider } from 'styled-components';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import {FaPlus,FaMinus,FaDatabase,FaHtml5,FaCss3,FaPaperclip,FaJs, FaPython, FaJava, FaReact} from "react-icons/fa";


const AC = styled.div`
.wrapper{
    height:100vh;
    width:100vw;
    position:relative;
    top:400px;
    left:50%;
    transform:translateX(-49%);
}
.accordion{
    width:2000px;
}
.item{
    background:Black;
    margin-bottom:5px;
    padding:10px 20px;
    margin:20px;

}
.title{
    color:white;
    display:flex;
    justify-content:space-between;
    align-items:center;
    ccursor:pointer;

}
.content{

    color:white;
    max-height:0;
    overflow:hidden;
    transition: all 0.5s cubic-bezier(0,1,0,1);

}
.content.show{
    color:white;
    height:auto;

    transition:all 0.5s cubic-bezier(1,0,1,0);
}
`;
function App() {
    // App.js
    const toggle =(i) =>{
        if(selected == i ){
            return setSeleted(null);
        }
        setSeleted(i);
    }
    const [selected,setSeleted]=useState(null);
    const [message, setMessage] = useState("");

    useEffect(() => {
        fetch('/home1')
        .then(response => response.text())
        .then(message => {
        setMessage(message);
        });
        },[])

    return (

        <div>
            <Switch>
                    <Route exact path="/" component={Profile} />
                    <Route path="/Profile_PJ" component={Profile_PJ}/>

            </Switch>
            <AC>
                        <div className='wrapper'>
                    <h1>Project_LIST <FaPaperclip style={{margin:"4px"}} /> </h1>

      <div className="accordion">
        <h1>경기도 공공 체육시설 조회 <FaHtml5/> <FaCss3/> <FaJs/> <FaJava/> <FaDatabase/> </h1>
        주요 기능 : 경기도에 있는 공공 체육시설들을 조회 할 수 있으며, 위치, 바닥 재질, 시설크기 등을 알 수 있고 검색하여 찾을 수 도 있다.<br></br>
        Frontend : HTML5, CSS3, Javascript<br></br>
        Backend : Java, JSP <br />
        DataBase : Mysql

      </div>
